import React, {useContext} from 'react';
import styled from "styled-components";
import { GlobalContext } from '../context/GlobalState';

const CSS = styled.div`
  width: fit;
  background: white;
  top:123px;

  .search-item{
    width:100%;
    text-align: left;
  }
`;

//graphSymbol(mySymbol.symbol, 'day', true)
export const SearchItem = ({ mySymbol }) => {
  const { graphSymbol } = useContext(GlobalContext);

  return (
    <div>
      <CSS>
        <button className="search-item" onClick={() => graphSymbol(mySymbol.symbol, 'day', true)}>
          <p><span className="">({mySymbol.symbol}) </span>{mySymbol.name}</p>
        </button>
      </CSS>
    </div>
  )
}
